import React from 'react'
import { Row, Col } from 'antd';

import Tshirt from '../components/Tshirt'
import CartPage from './CartPage'

const ProductPage = () => {

    const database = [
        { name : "red tshirt " , img: "https://asda.scene7.com/is/image/Asda/5054065447503?hei=686&wid=516&qlt=85&fmt=pjpg&resmode=sharp&op_usm=1.1,0.5,0,0&defaultimage=default_details_George_rd" , price:150 , id : 1},
        { name : "yellow tshirt " , img: "https://www.looksharpstore.co.nz/wp-content/uploads/2018/04/T190-yellow.jpg" , price:180 , id : 2},
        { name : "green tshirt ", img:"https://www.kidswholesaleclothing.co.uk/4131-large_default/baby-blanks-short-sleeve-tshirt-emerald.jpg" , price:200 , id : 3}
    ]

    return (
        <div>
            <Row>
            {
                database.map(item =>(
                    <Col span={8}>
                    <Tshirt id={item.id} name={item.name} price={item.price} key={item.id} />
                    </Col>
                ))
            }

            </Row>

        </div>
    )
}

export default ProductPage
